import React from 'react';

function Cmview({ commentList }) {
  return (
    <div>
      {commentList.map((item) => {
        return (
          <div>
            <p>{item.id}</p>
            <p>{item.comment}</p>
            <span>{item.userName}</span>
          </div>
        );
      })}
    </div>
  );
}

export default Cmview;
